CREATE DATABASE  IF NOT EXISTS `riocuarto`;
USE `riocuarto`;

CREATE TABLE `vehiculos` (
    `REGISTRO` VARCHAR(7) CHARACTER SET utf8,
    `FECHA` VARCHAR(19) CHARACTER SET utf8,
    `HORA` VARCHAR(9) CHARACTER SET utf8,
    `DESCRIPCION` VARCHAR(5) CHARACTER SET utf8,
    `DOMINIO` VARCHAR(8) CHARACTER SET utf8,
    `MARCA` VARCHAR(10) CHARACTER SET utf8,
    `MODELO` VARCHAR(11) CHARACTER SET utf8,
    `MOTIVO` VARCHAR(25) CHARACTER SET utf8,
    `LEVANTADO_EN` VARCHAR(67) CHARACTER SET utf8,
    `ACTA_DE_COMPROBACION` VARCHAR(17) CHARACTER SET utf8,
    `ACTA_CONTRAVENCIONAL` VARCHAR(8) CHARACTER SET utf8,
    `BOLETA_DE_CITACION` VARCHAR(9) CHARACTER SET utf8,
    `AGENTE_LABRANTE` VARCHAR(41) CHARACTER SET utf8,
    `INFRACTOR_CONTRAVENTOR` VARCHAR(32) CHARACTER SET utf8,
    `AGENTE_DE_PLAYA_QUE_RECIBIO` VARCHAR(22) CHARACTER SET utf8,
    `GRUA_CHOFER` VARCHAR(27) CHARACTER SET utf8,
    `INVENTARIO_SI_NO` VARCHAR(3) CHARACTER SET utf8,
    `N_CHASIS_Y_MOTOR` VARCHAR(54) CHARACTER SET utf8,
    `FECHA_ENTREGA` DATETIME,
    `HORA_ENTREGA` VARCHAR(8) CHARACTER SET utf8,
    `QUE_RETIR_indicar_si_es_Titular_o_Conductor_Autorizado_y_DNI` VARCHAR(89) CHARACTER SET utf8,
    `ENTREGA_AGENTE` VARCHAR(12) CHARACTER SET utf8,
    `NOTAS` VARCHAR(105) CHARACTER SET utf8,
    `CONTROL_DE_LEGALES` INT,
    `TRASLADO_A_COMPACTACION_SI_NO` VARCHAR(2) CHARACTER SET utf8
);

select * from vehiculos;
